import React from 'react';
import '../../test.css';

const ListItems=()=>{
    const arr = ['Data 1', 'Data 2', 'Data 3', 'Data 4', 'Data 5', 'Data 6']
    const data = arr.map((el)=>{
        return  <li className='hello'>{el}</li>
    })
    return(
        <div>
            {data}
        </div>
    )
};

export default ListItems;
